import './App.css';
import Button from './components/Button/Button';
import Header from './components/Header/Header';
import Logo from './components/Logo/Logo';
import Search from './components/Search/Search';

function App() {
  return (
    <>
      <Header>
        <>
          <Logo />
          <Search />
        </>
      </Header>
      <Button text={'В корзину'} />
    </>
  );
}

export default App;
